"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: What can go wrong after a heart attack? (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/what-can-go-wrong-after-a-heart-attack-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H25937959\">",
"      <span class=\"h1\">",
"       Why can problems happen after a heart attack?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Problems can happen because part of the heart is damaged or dies during a heart attack. This can cause the heart to beat abnormally. The damage can also lead to problems with the heart walls or valves (",
"      <a class=\"graphic graphic_figure graphicRef56936 \" href=\"mobipreview.htm?9/42/9888\">",
"       figure 1",
"      </a>",
"      ).",
"     </p>",
"     <p>",
"      Whether or not problems happen after a heart attack and how serious they are depends on:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        How serious the heart attack was, how much of the heart was damaged, and which part of the heart was damaged",
"       </li>",
"       <li>",
"        How quickly the heart attack was treated",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H25937966\">",
"      <span class=\"h1\">",
"       What problems can happen after a heart attack?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Different problems can happen in the days to weeks after a heart attack. Some problems are not too serious and can be treated, but others can cause death.",
"     </p>",
"     <p>",
"      The most common problems that can happen after a heart attack are:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        <strong>",
"         Abnormal heart rhythms",
"        </strong>",
"        &mdash; Each person has a built-in electrical system in the heart that controls his or her heartbeat. After a heart attack, the electrical signals that control the heartbeat can become abnormal and cause an abnormal heart rhythm. Abnormal heart rhythms are also called &ldquo;arrhythmias.&rdquo;",
"        <br/>",
"        <br/>",
"        An abnormal heart rhythm can cause people to feel like their heart is racing, skipping beats, or beating out of sync. An abnormal heart rhythm can also cause dizziness, fainting, or even death.",
"        <br/>",
"        <br/>",
"        Treatment depends on the type of abnormal rhythm and the person&rsquo;s symptoms and can include:",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      <ul class=\"hyphen-block\">",
"       <li>",
"        &ldquo;Watching and waiting&rdquo; &mdash; If your abnormal heart rhythm isn&rsquo;t too serious, the doctor might watch it to see if it goes away on its own.",
"       </li>",
"       <li>",
"        Different types of medicines",
"       </li>",
"       <li>",
"        A procedure called &ldquo;cardioversion,&rdquo; which involves applying a mild electrical current to the heart to fix its rhythm",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        <strong>",
"         Heart failure",
"        </strong>",
"        &mdash; Heart failure is a condition in which the heart does not pump as well as it should. This can cause symptoms such as swelling (",
"        <a class=\"graphic graphic_picture graphicRef61706 \" href=\"mobipreview.htm?15/43/16050\">",
"         picture 1",
"        </a>",
"        ), trouble breathing, and feeling tired. Sometimes, heart failure after a heart attack lasts only for a short time. Other times, heart failure after a heart attack becomes a long-term problem.",
"        <br/>",
"        <br/>",
"        Doctors can treat heart failure with different types of medicines. (See",
"        <a class=\"medical medical_basics\" href=\"mobipreview.htm?35/41/36499?source=see_link\">",
"         \"Patient information: Medicines for heart failure (The Basics)\"",
"        </a>",
"        .) The medicines can improve symptoms and help people feel better. Some medicines help people live longer. Most people need to take more than 1 medicine every day.",
"       </li>",
"       <li>",
"        <strong>",
"         Inflammation of the lining around the heart",
"        </strong>",
"        &mdash; When the lining around the heart gets inflamed or irritated, doctors call it &ldquo;pericarditis.&rdquo; Pericarditis can cause chest pain that gets worse when you cough or take a deep breath. Sometimes, it also causes a fever.",
"        <br/>",
"        <br/>",
"        If you have pericarditis, your doctor will probably first treat it by increasing your daily dose of",
"        <a class=\"drug drug_patient\" href=\"mobipreview.htm?6/12/6342?source=see_link\">",
"         aspirin",
"        </a>",
"        . (After a heart attack, most people take aspirin every day.) He or she might also prescribe another NSAID. NSAIDs are a large group of medicines that includes aspirin,",
"        <a class=\"drug drug_patient\" href=\"mobipreview.htm?14/17/14614?source=see_link\">",
"         ibuprofen",
"        </a>",
"        (sample brand names: Advil&reg;, Motrin&reg;),",
"        <a class=\"drug drug_patient\" href=\"mobipreview.htm?0/34/550?source=see_link\">",
"         indomethacin",
"        </a>",
"        (sample brand names: Indocin&reg;, Indocid&reg;), and",
"        <a class=\"drug drug_patient\" href=\"mobipreview.htm?43/35/44597?source=see_link\">",
"         naproxen",
"        </a>",
"        (sample brand names: Aleve&reg;, Naprosyn&reg;).",
"        <br/>",
"        <br/>",
"        If the inflammation causes fluid to collect around your heart, your doctor might drain the fluid.",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      Other problems can happen after a heart attack, but they are much less common. These problems usually happen within the first few days after a heart attack and can be life-threatening. They include:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Tears in the heart muscle or heart walls",
"       </li>",
"       <li>",
"        Problems with the heart valves",
"       </li>",
"       <li>",
"        Blood clots in the lung",
"       </li>",
"       <li>",
"        Strokes",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      These problems usually cause sudden and severe symptoms, such as sudden trouble breathing or passing out. They need emergency treatment, which might include medicines, surgery, or other procedures. But these problems can&rsquo;t always be treated and sometimes lead to death.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H25937973\">",
"      <span class=\"h1\">",
"       More on this topic",
"      </span>",
"     </p>",
