"      <br/>",
"      <a class=\"medical medical_basics\" href=\"mobipreview.htm?25/12/25795?source=see_link\">",
"       Patient information: Ventricular fibrillation (The Basics)",
"      </a>",
"     </p>",
"     <p>",
"      <a class=\"medical medical_patient\" href=\"mobipreview.htm?39/16/40195?source=see_link\">",
